function bar1(tt::Array{Int,1})
	tt_cp = Array{Int,1}()
	for i in tt
       push!(tt_cp,i)
    end
    return tt_cp
end


function bar2(tt::Array{Int,1})
	tt_cp = Array{Int,1}()
	i=1
	while i<=length(tt)
       push!(tt_cp,tt[i])
       i += 1
    end
    return tt_cp
end


