	while i<=length(tt)
		# @show idx
		ntype = tt[idx]
		idx += 1
		if(ntype == 2)
			v = pvals[tt[idx]]
			idx += 1
			push!(vals,v)
			idx += 1 #skip TYPE_P
		elseif(ntype == 1)
			v = vvals[tt[idx]]
			idx += 1
			push!(vals,v)
			idx += 1 #skip TYPE_V
		elseif(ntype == 3)
			nvals = Array{Float64,1}()
			oc = tt[idx]
			idx += 1
			n = tt[idx]
			idx += 1
			idx += 1 #skip TYPE_O
			# s = OP[oc]
			while n>0
				prepend!(nvals,[pop!(vals)])
				n -= 1
			end
			
			# @show OP[oc]
			# @show nvals

			if(OP[oc] == :+)
				v = Base.sum(nvals)
			elseif(OP[oc] == :-)
				v = (-)(nvals[1],nvals[2])
			elseif(OP[oc] == :*)
				v = Base.prod(nvals)
			elseif(OP[oc] == :/)
				v =  (/)(nvals[1],nvals[2])
			elseif(OP[oc] == :^)
				v =  (^)(nvals[1],nvals[2])
			elseif(OP[oc] == :sin)
				v =  sin(nvals[1])
			elseif(OP[oc] == :cos)
				v =  cos(nvals[1])
			end
			# @show v
			push!(vals,v)
		else
			assert(false)
		end
	end
	# @show vals
	return pop!(vals)
end